import React from "react";
const PokemonPreview = (props) => {
  const name = props.previewInfo.name;
  const id = props.previewInfo.id;
  const image = props.previewInfo.im
  return (
    <React.Fragment>
      <div>{name}</div>
      <div>{id}</div>
    </React.Fragment>
  );
};
export default PokemonPreview;
